import React, { useEffect, useState } from 'react';

function WellnessReport() {
  const [data, setData] = useState([]);
  const [dailyGroupAverages, setDailyGroupAverages] = useState([]);
  const [rollingGroupAverages, setRollingGroupAverages] = useState([]);
  const [expandedPlayers, setExpandedPlayers] = useState({});
  const [playerRollingAverages, setPlayerRollingAverages] = useState({});
  const [customRange, setCustomRange] = useState({ from: '', to: '' });
  const [customGroupAverage, setCustomGroupAverage] = useState(null);

  const sheetUrl = "https://opensheet.elk.sh/1x1e53gsx3VzEJ5ON5QOvYeJTGI8auMtSxJYYpUUmreY/Wallnes";

  useEffect(() => {
    fetch(sheetUrl)
      .then(res => res.json())
      .then(json => {
        const sorted = json.sort((a, b) => new Date(a.Timestamp) - new Date(b.Timestamp));
        setData(sorted);
        processGroupStats(sorted);
        processPlayerRollingStats(sorted);
      });
  }, []);

  const processGroupStats = (entries) => {
    const groupedByDate = {};
    entries.forEach(entry => {
      const date = new Date(entry.Timestamp).toLocaleDateString();
      if (!groupedByDate[date]) groupedByDate[date] = [];
      groupedByDate[date].push(entry);
    });

    const dates = Object.keys(groupedByDate).slice(-5);
    const daily = dates.map(date => {
      const dayEntries = groupedByDate[date];
      const stats = { sleep: 0, sore: 0, fatigue: 0 };
      dayEntries.forEach(entry => {
        stats.sleep += Number(entry["What is the quality of your sleep at night?"]) || 0;
        stats.sore += Number(entry["How sore are you?"]) || 0;
        stats.fatigue += Number(entry["How Fatigued are you?"]) || 0;
      });
      const count = dayEntries.length;
      return {
        date,
        sleep: (stats.sleep / count).toFixed(2),
        sore: (stats.sore / count).toFixed(2),
        fatigue: (stats.fatigue / count).toFixed(2)
      };
    });
    setDailyGroupAverages(daily);

    const rolling = [];
    for (let days = 1; days <= 5; days++) {
      const recent = entries.slice(-days * 5); // assuming max 5 per day
      const stats = { sleep: 0, sore: 0, fatigue: 0 };
      recent.forEach(entry => {
        stats.sleep += Number(entry["What is the quality of your sleep at night?"]) || 0;
        stats.sore += Number(entry["How sore are you?"]) || 0;
        stats.fatigue += Number(entry["How Fatigued are you?"]) || 0;
      });
      const count = recent.length;
      rolling.push({
        days,
        sleep: (stats.sleep / count).toFixed(2),
        sore: (stats.sore / count).toFixed(2),
        fatigue: (stats.fatigue / count).toFixed(2)
      });
    }
    setRollingGroupAverages(rolling);
  };

  const processPlayerRollingStats = (entries) => {
    const players = {};
    entries.forEach(entry => {
      const name = entry.Name;
      const timestamp = new Date(entry.Timestamp);
      const sleep = Number(entry["What is the quality of your sleep at night?"]) || 0;
      const sore = Number(entry["How sore are you?"]) || 0;
      const fatigue = Number(entry["How Fatigued are you?"]) || 0;
      if (!players[name]) players[name] = [];
      players[name].push({ timestamp, sleep, sore, fatigue });
    });

    const result = {};
    Object.keys(players).forEach(name => {
      const sorted = players[name].sort((a, b) => a.timestamp - b.timestamp);
      result[name] = [];
      for (let days = 2; days <= 5; days++) {
        const recent = sorted.slice(-days);
        const total = recent.reduce((acc, cur) => {
          acc.sleep += cur.sleep;
          acc.sore += cur.sore;
          acc.fatigue += cur.fatigue;
          return acc;
        }, { sleep: 0, sore: 0, fatigue: 0 });
        result[name].push({
          days,
          sleep: (total.sleep / days).toFixed(2),
          sore: (total.sore / days).toFixed(2),
          fatigue: (total.fatigue / days).toFixed(2)
        });
      }
    });
    setPlayerRollingAverages(result);
  };

  const togglePlayerExpand = (name) => {
    setExpandedPlayers(prev => ({ ...prev, [name]: !prev[name] }));
  };

  return (
    <div className="wellness-report" dir="rtl" style={{ padding: '20px' }}>
      <h1> Wellness</h1>

      <h2>爪注 拽爪转 驻 转专 专</h2>
      <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%", textAlign: "center" }}>
        <thead>
          <tr>
            <th>转专</th>
            <th>砖 </th>
            <th>注驻转 </th>
            <th> </th>
          </tr>
        </thead>
        <tbody>
          {dailyGroupAverages.map((d, i) => (
            <tr key={i}>
              <td>{d.date}</td>
              <td>{d.sleep}</td>
              <td>{d.fatigue}</td>
              <td>{d.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2 style={{ marginTop: '40px' }}>爪注 拽爪转 转</h2>
      <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%", textAlign: "center" }}>
        <thead>
          <tr>
            <th>住驻专 </th>
            <th>砖 </th>
            <th>注驻转 </th>
            <th> </th>
          </tr>
        </thead>
        <tbody>
          {rollingGroupAverages.map((r, i) => (
            <tr key={i}>
              <td>{r.days}</td>
              <td>{r.sleep}</td>
              <td>{r.fatigue}</td>
              <td>{r.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2 style={{ marginTop: '40px' }}>爪注 驻 砖拽转</h2>
      {Object.keys(playerRollingAverages).map(name => (
        <div key={name}>
          <button onClick={() => togglePlayerExpand(name)}>
            {expandedPlayers[name] ? '住转专 爪注' : `爪 爪注 注专 ${name}`}
          </button>
          {expandedPlayers[name] && (
            <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%", marginTop: '10px', marginBottom: '20px', textAlign: "center" }}>
              <thead>
                <tr>
                  <th>住驻专 </th>
                  <th>砖 </th>
                  <th>注驻转 </th>
                  <th> </th>
                </tr>
              </thead>
              <tbody>
                {playerRollingAverages[name].map((r, i) => (
                  <tr key={i}>
                    <td>{r.days}</td>
                    <td>{r.sleep}</td>
                    <td>{r.fatigue}</td>
                    <td>{r.sore}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      ))}
    </div>
  );
}

export default WellnessReport;
